window.bookSummaryJSON = "<p>It's not just Alexander Kempthorne's secrets bubbling to the surface of London's streets....</p> <p>Time is running out for John \"Dom\" Domenici.</p> <p>Outmaneuvered at every turn by the figure known as \"M,\" only Kempthorne can free Dom, but juggling the horrors of his own past, containing a rising preternatural threat and the twisted machinations of \"M\" might just be too much, even for Kempthorne. Can Kage Mitchell be trusted to help?</p> <p>Alexander Kempthorne lost an agent before. He'll not lose another. He'll do anything to save Dom, and if that means revealing who and what he truly is, then his time has come.</p> <p>Contains mature themes.</p>"; 
